{
    "openapi": "3.0.0",
    "info": {
        "title": "Logistics API",
        "description": "Module responsible for shipping calculation and inventory control.\n\nThe variable {{environment}} can be filled with vtexcommercestable or vtexcommercebeta, depending on the environment you want to test.",
        "contact": {},
        "version": "1.0"
    },
    "servers": [
        {
            "url": "https://{accountName}.{environment}.com.br/api",
            "description": "VTEX server url",
            "variables": {
                "accountName": {
                    "description": "Name of the VTEX account. Used as part of the URL",
                    "default": "{accountName}"
                },
                "environment": {
                    "description": "Environment to use. Used as part of the URL.",
                    "default": "{environment}"
                }
            }
        }
    ],
    "paths": {
        "/logistics/pvt/shipping-policies/{id}": {
            "get": {
                "tags": ["Shipping Policies"],
                "summary": "Retrieve shipping policy by ID",
                "description": "This endpoint lists existing shipping policies from carriers in your store, searching by their IDs.\n\r\n\r> Note that, while most of our API endpoints return time fields in UTC, this endpoint returns **Scheduled Delivery** related time fields adjusted to the configured time zone of the account.",
                "parameters": [
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "id",
                        "in": "path",
                        "required": true,
                        "description": "ID of the shipping policy.",
                        "schema": {
                            "type": "string",
                            "default": "id"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                }
            },
            "delete": {
                "tags": ["Shipping Policies"],
                "summary": "Delete shipping policies by ID",
                "description": "This endpoint deletes existing shipping policies from carriers in your store, searching by their IDs.",
                "parameters": [
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "id",
                        "in": "path",
                        "required": true,
                        "description": "ID of the shipping policy.",
                        "schema": {
                            "type": "string",
                            "default": "id"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                }
            },
            "put": {
                "tags": ["Shipping Policies"],
                "summary": "Update shipping policy",
                "description": "This endpoint updates information on existing Shipping Policies from carriers.\n\r\n\r> Note that, while most of our API endpoints return time fields in UTC, this endpoint returns **Scheduled Delivery** related time fields adjusted to the configured time zone of the account.",
                "parameters": [
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "id",
                        "in": "path",
                        "required": true,
                        "description": "Shipping policy's ID",
                        "schema": {
                            "type": "string",
                            "default": "shippingpolicyid1"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                },
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "type": "object",
                                "title": "Request body",
                                "default": {},
                                "required": [
                                    "name",
                                    "shippingMethod",
                                    "deliveryOnWeekends",
                                    "maxDimension",
                                    "isActive"
                                ],
                                "properties": {
                                    "name": {
                                        "type": "string",
                                        "title": "name",
                                        "description": "Name of the shipping policy",
                                        "default": "Correios PAC"
                                    },
                                    "shippingMethod": {
                                        "type": "string",
                                        "title": "shippingMethod",
                                        "description": "Type of shipping available for this shipping policy (carrier). Options shown on freight simulation.",
                                        "default": "Normal"
                                    },
                                    "deliveryOnWeekends": {
                                        "type": "boolean",
                                        "title": "deliveryOnWeekends",
                                        "description": "If the shipping policy (carrier) delivers on weekends",
                                        "default": false
                                    },
                                    "maxDimension": {
                                        "type": "object",
                                        "title": "maxDimension",
                                        "description": "Object containing attributes of maximum dimension permitted by the shipping policy (carrier).",
                                        "default": {},
                                        "required": [
                                            "largestMeasure",
                                            "maxMeasureSum"
                                        ],
                                        "properties": {
                                            "largestMeasure": {
                                                "type": "number",
                                                "title": "largestMeasure",
                                                "description": "Largest measure of the package.",
                                                "default": 0.0
                                            },
                                            "maxMeasureSum": {
                                                "type": "number",
                                                "title": "maxMeasureSum",
                                                "description": "Sum of all maximum measures of the package.",
                                                "default": 0.0
                                            }
                                        }
                                    },
                                    "isActive": {
                                        "type": "boolean",
                                        "title": "isActive",
                                        "description": "If the shipping policy is active or not.",
                                        "default": true
                                    },
                                    "deliveryScheduleSettings": {
                                        "type": "object",
                                        "description": "Settings for the Scheduled Delivery feature.",
                                        "required": [
                                            "useDeliverySchedule",
                                            "dayOfWeekForDelivery",
                                            "maxRangeDelivery"
                                        ],
                                        "properties": {
                                            "useDeliverySchedule": {
                                                "type": "boolean",
                                                "description": "Select the Scheduled Delivery configuration.",
                                                "default": true
                                            },
                                            "maxRangeDelivery": {
                                                "type": "number",
                                                "description": "Range of days available within a delivery window, for the customer to choose the scheduled delivery. For example, if the configured maxRangeDelivery is equal 7, and the customer buys something on a Tuesday, the options for scheduled delivery will be shown until the following Tuesday (7 days from the purchase day). If no options are available within the maxRangeDelivery set, this shipping policy won't be shown on the checkout.",
                                                "default": 0.0
                                            },
                                            "dayOfWeekForDelivery": {
                                                "type": "object",
                                                "description": "Select the chosen days for delivery. Values for each day of the week are: 0 = sunday, 1 = monday, 2 = tuesday, 3 = wednesday, 4 = thursday, 5 = friday, 6 = saturyday. Make sure to add the available hours for the chosen days, following the example.",
                                                "required": [
                                                    "dayOfWeek",
                                                    "deliveryRanges"
                                                ],
                                                "properties": {
                                                    "dayOfWeek": {
                                                        "type": "integer",
                                                        "description": "Day of the week, from `0` (sunday) to `6` (saturday).",
                                                        "default": 2
                                                    },
                                                    "deliveryRanges": {
                                                        "type": "array",
                                                        "description": "Reservation windows for scheduled delivery.",
                                                        "items": {
                                                            "type": "object",
                                                            "required": [
                                                                "startTime",
                                                                "endTime",
                                                                "listPrice"
                                                            ],
                                                            "properties": {
                                                                "startTime": {
                                                                    "type": "string",
                                                                    "title": "startTime",
                                                                    "description": "Start time for day of the week.",
                                                                    "default": "11:00:00"
                                                                },
                                                                "endTime": {
                                                                    "type": "string",
                                                                    "description": "End time for day of the week.",
                                                                    "default": "12:30:00"
                                                                },
                                                                "listPrice": {
                                                                    "type": "number",
                                                                    "description": "List price for day of the week.",
                                                                    "default": "0.0"
                                                                },
                                                                "deliveryCapacity": {
                                                                    "type": "object",
                                                                    "description": "Sets maximum delivery capacity for a given reservation window for scheduled delivery.",
                                                                    "default": null,
                                                                    "required": [
                                                                        "capacityType",
                                                                        "maxValue"
                                                                    ],
                                                                    "properties": {
                                                                        "capacityType": {
                                                                            "type": "string",
                                                                            "description": "Defines how the delivery capacity is measured for this reservation window, by maximum number of orders (`\"ORDERS_QUANTITY\"`) or SKUs (`\"SKUS_QUANTITY\"`).",
                                                                            "default": "ORDERS_QUANTITY"
                                                                        },
                                                                        "maxValue": {
                                                                            "type": "number",
                                                                            "description": "Maximum number of orders or SKUs that the store is capable of fulfilling.",
                                                                            "default": "0.0"
                                                                        }
                                                                    }
                                                                }
                                                            }
                                                        }
                                                    }
                                                }
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
        },
        "/logistics/pvt/shipping-policies": {
            "get": {
                "tags": ["Shipping Policies"],
                "summary": "List shipping policies",
                "description": "This endpoint lists existing shipping policies from carriers in your store.\n\r\n\r> Note that, while most of our API endpoints return time fields in UTC, this endpoint returns **Scheduled Delivery** related time fields adjusted to the configured time zone of the account.",
                "parameters": [
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "page",
                        "in": "query",
                        "required": true,
                        "description": "Desired number of pages to retrieve information from your Shipping Policies.",
                        "schema": {
                            "type": "string",
                            "default": "page"
                        }
                    },
                    {
                        "name": "perPage",
                        "in": "query",
                        "required": true,
                        "description": "Desired number of items per page, to retrieve information from your Shipping Policies.",
                        "schema": {
                            "type": "string",
                            "default": "perPage"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                }
            },
            "post": {
                "tags": ["Shipping Policies"],
                "summary": "Create shipping policy",
                "description": "This endpoint creates new shipping policies from carriers in your store.\n\r\n\r> Note that, while most of our API endpoints return time fields in UTC, this endpoint returns **Scheduled Delivery** related time fields adjusted to the configured time zone of the account.",
                "parameters": [
                    {
                        "name": "Accept",
                        "in": "header",
                        "description": "HTTP Client Negotiation Accept Header. Indicates the types of responses the client can understand",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    },
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                },
                "requestBody": {
                    "description": "",
                    "content": {
                        "application/json": {
                            "schema": {
                                "type": "object",
                                "title": "Request body",
                                "default": {},
                                "required": [
                                    "id",
                                    "name",
                                    "shippingMethod",
                                    "weekendAndHolidays",
                                    "maxDimension",
                                    "numberOfItemsPerShipment",
                                    "minimumValueAceptable",
                                    "maximumValueAceptable",
                                    "deliveryScheduleSettings",
                                    "cubicWeightSettings",
                                    "modalSettings",
                                    "businessHourSettings",
                                    "pickupPointsSettings",
                                    "isActive"
                                ],
                                "properties": {
                                    "id": {
                                        "type": "string",
                                        "title": "id schema",
                                        "description": "ID of the shipping policy.",
                                        "default": "123"
                                    },
                                    "name": {
                                        "type": "string",
                                        "title": "name",
                                        "description": "Name of the shipping policy.",
                                        "default": "Normal"
                                    },
                                    "shippingMethod": {
                                        "type": "string",
                                        "title": "shippingMethod",
                                        "description": "Type of shipping available for this shipping policy (carrier). Options shown on freight simulation",
                                        "default": "Normal"
                                    },
                                    "weekendAndHolidays": {
                                        "type": "object",
                                        "title": "weekendAndHolidays",
                                        "description": "If the shipping policy includes deliveries on weekends and holidays.",
                                        "default": {},
                                        "required": [
                                            "saturday",
                                            "sunday",
                                            "holiday"
                                        ],
                                        "properties": {
                                            "saturday": {
                                                "type": "boolean",
                                                "title": "saturday",
                                                "description": "Does the shipping policy allow deliveries on saturdays?",
                                                "default": false
                                            },
                                            "sunday": {
                                                "type": "boolean",
                                                "title": "sunday",
                                                "description": "Does the shipping policy allow deliveries on sundays?",
                                                "default": false
                                            },
                                            "holiday": {
                                                "type": "boolean",
                                                "title": "holiday",
                                                "description": "Does the shipping policy allow deliveries onholidays?",
                                                "default": false
                                            }
                                        }
                                    },
                                    "maxDimension": {
                                        "type": "object",
                                        "title": "maxDimension",
                                        "description": "Object containing attributes of maximum dimension permitted by the shipping policy (carrier).",
                                        "default": {},
                                        "required": [
                                            "largestMeasure",
                                            "maxMeasureSum"
                                        ],
                                        "properties": {
                                            "largestMeasure": {
                                                "type": "number",
                                                "title": "largestMeasure",
                                                "description": "Largest measure of the package.",
                                                "default": 0.0
                                            },
                                            "maxMeasureSum": {
                                                "type": "number",
                                                "title": "maxMeasureSum",
                                                "description": "Sum of all maximum measures of the package.",
                                                "default": 0.0
                                            }
                                        }
                                    },
                                    "numberOfItemsPerShipment": {
                                        "type": "integer",
                                        "title": "numberOfItemsPerShipment",
                                        "description": "Capacity of your store's logistics of shipment, determines number of items permitted per shipment.",
                                        "default": null
                                    },
                                    "minimumValueAceptable": {
                                        "type": "number",
                                        "title": "minimumValueAceptable",
                                        "description": "Minimum value accepted by the carrier, to realize the shipping.",
                                        "default": 0.0
                                    },
                                    "maximumValueAceptable": {
                                        "type": "number",
                                        "title": "maximumValueAceptable",
                                        "description": "Maximum value accepted by the carrier, to realize the shipping.",
                                        "default": 0.0
                                    },
                                    "deliveryScheduleSettings": {
                                        "type": "object",
                                        "title": "deliveryScheduleSettings",
                                        "description": "Settings for the Scheduled Delivery feature.",
                                        "default": {},
                                        "required": [
                                            "useDeliverySchedule",
                                            "dayOfWeekForDelivery",
                                            "maxRangeDelivery"
                                        ],
                                        "properties": {
                                            "useDeliverySchedule": {
                                                "type": "boolean",
                                                "title": "useDeliverySchedule",
                                                "description": "Select the Scheduled Delivery configuration.",
                                                "default": true
                                            },
                                            "maxRangeDelivery": {
                                                "type": "number",
                                                "title": "maxRangeDelivery",
                                                "description": "Range of days available within a delivery window, for the customer to choose the scheduled delivery. For example, if the configured maxRangeDelivery is equal 7, and the customer buys something on a Tuesday, the options for scheduled delivery will be shown until the following Tuesday (7 days from the purchase day). If no options are available within the maxRangeDelivery set, this shipping policy won't be shown on the checkout.",
                                                "default": 0.0
                                            },
                                            "dayOfWeekForDelivery": {
                                                "type": "object",
                                                "title": "dayOfWeekForDelivery",
                                                "description": "Select the chosen days for delivery. Values for each day of the week are: 0 = sunday, 1 = monday, 2 = tuesday, 3 = wednesday, 4 = thursday, 5 = friday, 6 = saturyday. Make sure to add the available hours for the chosen days, following the example.",
                                                "default": {},
                                                "required": [
                                                    "dayOfWeek",
                                                    "deliveryRanges"
                                                ],
                                                "properties": {
                                                    "dayOfWeek": {
                                                        "type": "integer",
                                                        "title": "dayOfWeek",
                                                        "description": "",
                                                        "default": 2
                                                    },
                                                    "deliveryRanges": {
                                                        "type": "array",
                                                        "title": "deliveryRanges",
                                                        "description": "Reservation windows for scheduled delivery.",
                                                        "default": [],
                                                        "required": [
                                                            "startTime",
                                                            "endTime",
                                                            "listPrice"
                                                        ],
                                                        "properties": {
                                                            "startTime": {
                                                                "type": "string",
                                                                "title": "startTime",
                                                                "description": "",
                                                                "default": "11:00:00"
                                                            },
                                                            "endTime": {
                                                                "type": "string",
                                                                "title": "endTime",
                                                                "description": "",
                                                                "default": "12:30:00"
                                                            },
                                                            "listPrice": {
                                                                "type": "number",
                                                                "title": "listPrice",
                                                                "description": "",
                                                                "default": "0.0"
                                                            },
                                                            "deliveryCapacity": {
                                                                "type": "object",
                                                                "description": "Sets maximum delivery capacity for a given reservation window for scheduled delivery.",
                                                                "default": null,
                                                                "required": [
                                                                    "capacityType",
                                                                    "maxValue"
                                                                ],
                                                                "properties": {
                                                                    "capacityType": {
                                                                        "type": "string",
                                                                        "description": "Defines how the delivery capacity is measured for this reservation window, by maximum number of orders (`\"ORDERS_QUANTITY\"`) or SKUs (`\"SKUS_QUANTITY\"`)."
                                                                    },
                                                                    "maxValue": {
                                                                        "type": "number",
                                                                        "description": "Maximum number of orders or SKUs that the store is capable of fulfilling.",
                                                                        "default": "0.0"
                                                                    }
                                                                }
                                                            }
                                                        }
                                                    }
                                                }
                                            }
                                        }
                                    },
                                    "carrierSchedule": {
                                        "type": "array",
                                        "title": "carrierSchedule",
                                        "description": "Schedule sent by the carrier, to configure Shipping policy",
                                        "items": {
                                            "type": "object",
                                            "properties": {
                                                "dayOfWeek": {
                                                    "type": "integer",
                                                    "description": "Day of the week, from `0` (sunday) to `6` (saturday).",
                                                    "example": 0
                                                },
                                                "timeLimit": {
                                                    "type": "string",
                                                    "description": "Time limit.",
                                                    "default": "time_limit"
                                                }
                                            }
                                        }
                                    },
                                    "cubicWeightSettings": {
                                        "type": "object",
                                        "title": "cubicWeightSettings",
                                        "description": "Measure that accounts a package's volume, and not only weight.",
                                        "default": {},
                                        "required": [
                                            "volumetricFactor",
                                            "minimunAcceptableVolumetricWeight"
                                        ],
                                        "properties": {
                                            "volumetricFactor": {
                                                "type": "number",
                                                "title": "volumetricFactor",
                                                "description": "Factor that will be used on the cubic weight calculation.",
                                                "default": 0.0
                                            },
                                            "minimunAcceptableVolumetricWeight": {
                                                "type": "number",
                                                "title": "minimunAcceptableVolumetricWeight",
                                                "description": "",
                                                "default": 0.0
                                            }
                                        }
                                    },
                                    "modalSettings": {
                                        "type": "object",
                                        "title": "modalSettings",
                                        "description": "",
                                        "default": {},
                                        "required": [
                                            "modals",
                                            "useOnlyItemsWithDefinedModal"
                                        ],
                                        "properties": {
                                            "modals": {
                                                "type": "array",
                                                "title": "modals",
                                                "description": "Type of special freight.",
                                                "default": []
                                            },
                                            "useOnlyItemsWithDefinedModal": {
                                                "type": "boolean",
                                                "title": "useOnlyItemsWithDefinedModal",
                                                "description": "",
                                                "default": false
                                            }
                                        }
                                    },
                                    "businessHourSettings": {
                                        "type": "object",
                                        "title": "businessHourSettings",
                                        "description": "",
                                        "default": {},
                                        "required": [
                                            "carrierBusinessHours",
                                            "isOpenOutsideBusinessHours"
                                        ],
                                        "properties": {
                                            "carrierBusinessHours": {
                                                "type": "array",
                                                "title": "carrierBusinessHours",
                                                "description": "Object containing business hour configuration",
                                                "default": [],
                                                "required": [
                                                    "openingTime",
                                                    "closingTime",
                                                    "dayOfWeek"
                                                ],
                                                "properties": {
                                                    "openingTime": {
                                                        "type": "string",
                                                        "title": "openingTime",
                                                        "description": "",
                                                        "default": "00:00:00"
                                                    },
                                                    "closingTime": {
                                                        "type": "string",
                                                        "title": "closingTime",
                                                        "description": "",
                                                        "default": "23:59:59"
                                                    },
                                                    "dayOfWeek": {
                                                        "type": "number",
                                                        "title": "dayOfWeek",
                                                        "description": "Same rule for values as the previous dayOfWeek attribute.",
                                                        "default": 1.0
                                                    }
                                                }
                                            },
                                            "isOpenOutsideBusinessHours": {
                                                "type": "boolean",
                                                "title": "isOpenOutsideBusinessHours",
                                                "description": "Select whether the shipping policy allows deliveries outside business hours.",
                                                "default": true
                                            }
                                        }
                                    },
                                    "pickupPointsSettings": {
                                        "type": "object",
                                        "title": "pickupPointsSettings",
                                        "description": "Configuration for Pickup Points.",
                                        "default": {},
                                        "required": [
                                            "pickupPointIds",
                                            "pickupPointTags",
                                            "sellers"
                                        ],
                                        "properties": {
                                            "pickupPointIds": {
                                                "type": "array",
                                                "title": "pickupPointIds",
                                                "description": "Insert the IDs for pickup points previously configured in your store.",
                                                "default": 123
                                            },
                                            "pickupPointTags": {
                                                "type": "array",
                                                "title": "pickupPointTags",
                                                "description": "Insert the tags for pickup points previously configured in your store.",
                                                "default": []
                                            },
                                            "sellers": {
                                                "type": "array",
                                                "title": "sellers",
                                                "description": "",
                                                "default": []
                                            }
                                        }
                                    },
                                    "isActive": {
                                        "type": "boolean",
                                        "description": "Indicates whether shipping policy is active or not.",
                                        "default": false
                                    }
                                }
                            }
                        }
                    }
                }
            }
        },
        "/logistics/pvt/configuration/freights/{carrierId}/values/update": {
            "post": {
                "tags": ["Freight Values"],
                "summary": "Create/update freight values",
                "description": "Creates or updates the freight values of your store's carriers. Learn more in [Shipping rate template](https://help.vtex.com/en/tutorial/planilha-de-frete--tutorials_127#).",
                "operationId": "Create/UpdateFreightValues",
                "parameters": [
                    {
                        "name": "Content-Type",
                        "in": "header",
                        "description": "Type of the content being sent",
                        "required": true,
                        "style": "simple",
                        "schema": {
                            "type": "string",
                            "example": "application/json; charset=utf-8"
                        }
                    },
                    {
